L'harmonica est un instrument de musique à vent et à anche libre fonctionnant sur le même principe que l'accordéon : des anches (lamelles) métalliques de longueurs différentes, produisent les notes en vibrant au passage de l'air, aspiré ou soufflé cette fois par la bouche, cette conjonction étant peu fréquente pour un instrument à vent. D'une tessiture normale de trois octaves, il se décline en trois grandes familles : 
*  l'harmonica diatonique simple ; 
*  l'harmonica diatonique double (appelé aussi trémolo) ; 
*  l'harmonica chromatique.

